import { Link } from "react-router-dom";
import {FaFacebookSquare} from 'react-icons/fa'

const year = new Date();
function Footer() {
  return (
    <div className="footer flex">
      <div className="grid">
        <div className="footer-menu">
            <Link to='#'></Link>
        </div>
        <p>Copyright &copy; {year.getFullYear()}</p>
      </div>

    </div>
  );
}

export default Footer;
